import React, { Fragment } from "react";
import { Box } from "rebass";

export const ResponseHandler = props => (
  <Fragment>
    {Object.keys(props.response).length === 0 &&
    props.response.constructor === Object ? (
      <Box>
        <pre>{JSON.stringify(props.response)}</pre>
      </Box>
    ) : (
      ""
    )}
  </Fragment>
);
